import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Open a product modal (use a unique product title text selector for reliability)
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });
    await page.click('text=Apple iPhone 15 Pro Max');

    // Wait for modal to appear (look for modal-content class inside a visible modal)
    await page.waitForSelector('.modal[style*="display: block"] .modal-content', { timeout: 5000 });

    // Screenshot with modal open
    const modalOpenShot = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: modalOpenShot });
    screenshots.push(modalOpenShot);

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to disappear (modal style should be display: none or not visible)
    await page.waitForSelector('.modal', { state: 'hidden', timeout: 5000 });

    // Screenshot after closing modal
    const modalClosedShot = path.join(screenshotsDir, 'step_3_modal_closed.png');
    await page.screenshot({ path: modalClosedShot });
    screenshots.push(modalClosedShot);

    // Extract data to verify modal is closed (check that modal is not visible)
    const isModalVisible = await page.evaluate(() => {
      const modal = document.querySelector('.modal');
      if (!modal) return false;
      const style = window.getComputedStyle(modal);
      return style.display !== 'none' && style.visibility !== 'hidden' && modal.offsetParent !== null;
    });

    return {
      success: !isModalVisible,
      action: "Opened a product modal and closed it with Escape key",
      extractedData: {
        modalStillVisible: isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
